const BlocoRepositorio = ({nome, descricao}) => {
    return (
        <>
            <div className='container-repositorio'>
                <h3 className='nome-repo'>{nome}</h3>
                <p>{descricao}</p>  
            </div>
        </>    
    )
}

export { BlocoRepositorio }
